import React, { useEffect, useState } from 'react';
import { animated } from 'react-spring'; // Assuming you're using react-spring for animations
import PublishModal from './PublishModal'; // Adjust the path as necessary

const FormDetailsPage = () => {
  const [visitorData, setVisitorData] = useState([]); // State for visitor data
  const [filteredVisitorData, setFilteredVisitorData] = useState([]); // State for filtered visitor data
  const [selectedVisitors, setSelectedVisitors] = useState([]); // State for selected visitors
  const [searchTerm, setSearchTerm] = useState(''); // State for search term
  const [isPublishModalOpen, setIsPublishModalOpen] = useState(false); // State for modal open/close
  const [publishedLink, setPublishedLink] = useState(''); // State for published link
  const [error, setError] = useState(''); // State for error handling

  // Fetch visitor data from the backend
  const fetchVisitorData = async () => {
    try {
      const response = await fetch('http://localhost:5000/visitors');
      const data = await response.json();
      
      // Check if the fetched data is valid
      if (data && Array.isArray(data.visitors)) {
        setVisitorData(data.visitors);
        setFilteredVisitorData(data.visitors); // Initialize filtered data
      } else {
        setError('No visitor data found.');
      }
    } catch (err) {
      console.error(err);
      setError('Failed to fetch visitor data.');
    }
  };

  // Effect to fetch visitor data on component mount
  useEffect(() => {
    fetchVisitorData();
  }, []);

  // Handle search input change
  const handleSearch = (event) => {
    const value = event.target.value;
    setSearchTerm(value);
    
    // Filter visitor data based on search term
    const filteredData = visitorData.filter(visitor =>
      visitor.institution_name.toLowerCase().includes(value.toLowerCase()) ||
      visitor.student_branch.toLowerCase().includes(value.toLowerCase())
    );
    setFilteredVisitorData(filteredData);
  };

  // Handle visitor selection
  const handleVisitorSelection = (id) => {
    setSelectedVisitors(prev =>
      prev.includes(id) ? prev.filter(visitorId => visitorId !== id) : [...prev, id]
    );
  };

  return (
    <animated.div>
      <div>
        <h1>Visitor Information</h1>
        {error && <div className="text-red-500">{error}</div>}
        <input
          type="text"
          placeholder="Search..."
          value={searchTerm}
          onChange={handleSearch}
          className="border p-2 mb-4"
        />
        <div className="overflow-x-auto">
          {filteredVisitorData.length > 0 ? (
            <div className="shadow overflow-hidden border-b border-gray-200 sm:rounded-lg">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      <input
                        type="checkbox"
                        onChange={() => {
                          // Logic for selecting all visitors can be implemented here
                        }}
                      />
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Institution Name
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Student Branch
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {filteredVisitorData.map(visitor => (
                    <tr key={visitor.id} className="hover:bg-gray-100">
                      <td className="px-6 py-4 whitespace-nowrap">
                        <input
                          type="checkbox"
                          checked={selectedVisitors.includes(visitor.id)}
                          onChange={() => handleVisitorSelection(visitor.id)}
                        />
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{visitor.institution_name}</td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{visitor.student_branch}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          ) : (
            <div className="text-gray-500 text-center p-4">No visitors found.</div>
          )}
        </div>
      </div>

      <PublishModal isOpen={isPublishModalOpen} onClose={() => setIsPublishModalOpen(false)} publishedLink={publishedLink} />
    </animated.div>
  );
};

export default FormDetailsPage;
